def generate_regular_bracket_sequence(n: int, k: int) -> str:
    z = int((-1 + sqrt(1 + 8 * k)) // 2)
    f = int(z * (z + 1) // 2 != k)
    if z + f >= n - 1:
        return 'Impossible'
    elif f:
        y = (z + 1) * (z + 2) // 2 - k
        return '(' * (z + 1) + ')' * y + '(' + ')' * (z + 2 - y) + '()' * (n - (z + 2))
    else:
        return '(' * (z + 1) + ')' * (z + 1) + '()' * (n - 1 - z)

